@Component({
  selector: 'app-bijkomende-info-lang',
  templateUrl: './bijkomende-info-lang.component.html',
  styleUrls: ['./bijkomende-info-lang.component.css']
})
export class BijkomendeInfoLangComponent implements OnInit {

  // inschrijvingen = [];
  jaar: number;

  inschrijving: Inschrijving;

  koppieRapport = new FormControl('', []);
  getuigschrift = new FormControl('', []);
  identiteitskaartIn = new FormControl('', []);
  attestLeerprobleem = new FormControl('', []);
  BASOfiche = new FormControl('', []);
  avondstudie = new FormControl('', []);
  voorkeurKlasgenootjes = new FormControl('', []);
  motivatie = new FormControl('', []);
  toestemmingOverleggen = new FormControl('', []);
  bijkomendGesprek = new FormControl('', []);
  middagpas = new FormControl('', []);

  koppieRapportGeg: string;
  getuigschriftGeg: string;
  identiteitskaartInGeg: string;
  attestLeerprobleemGeg: string;
  BASOficheGeg: string;
  avondstudieGeg: string;
  voorkeurKlasgenootjesGeg: string;
  motivatieGeg: string;
  toestemmingOverleggenGeg: string;
  bijkomendGesprekGeg: string;
  middagpasGeg: string;

  // decryptionKey: string = "4e5h1e52z6cz5/g6z46";


  constructor(private service: InschrijvingService, private http: Http, public dialog: MatDialog, private router: Router) {
    this.jaar = Number.parseInt(this.service.jaar);
    
    // this.service.getAllInschrijvingen().subscribe(res => {
    //   res.json().forEach(element => {
    //     var inschrijving = new Inschrijving();
    //     inschrijving = element;

    //     this.inschrijvingen.push(inschrijving);
    //   });
    // });
  }

  ngOnInit() {
    this.inschrijving = this.service.getLocalInschrijving();
    this.koppieRapportGeg = this.inschrijving.ikopieRapport;
    this.getuigschriftGeg = this.inschrijving.ikopieOrigineelGetuigschrift;
    this.identiteitskaartInGeg = this.inschrijving.biidentiteitskaart;
    this.attestLeerprobleemGeg = this.inschrijving.iattestLeerPU;
    this.BASOficheGeg = this.inschrijving.ibaSOfiche;
    this.avondstudieGeg = this.inschrijving.biavondstudie;
    this.voorkeurKlasgenootjesGeg = this.inschrijving.biklasgenoten;
    this.motivatieGeg = this.inschrijving.bikeuze;
    this.toestemmingOverleggenGeg = this.inschrijving.bioverlegmoment;
    this.bijkomendGesprekGeg = this.inschrijving.bigesprekKlassenLeraar;
    this.middagpasGeg = this.inschrijving.BIMiddagpas;


    console.log("Is it filled?  " + this.inschrijving.geboorteDatum);

  }

  downloadPDF() {
    const doc = new jsPDF();

    //#region LongImageDataLogo
    var imgData = 'data:image/png;base64,';
    //#endregion
    var foto = this.inschrijving.foto;

    doc.addImage(imgData, 'PNG', 15, 15, 30, 30);

    if (foto == null) {
      console.log("No photo");
    } else {
      doc.addImage(foto, 'PNG', 160, 102, 35, 50);
    }

    doc.setFontType("bold");
    doc.setFontSize(15);
    doc.text("Katholieke Scholengemeenschap Sint-Martinus Herk-de-Stad", 50, 25);
    doc.text("CAMPUS URSULA", 50, 32);
    doc.text("__________________________________________________________________________________________________", 50, 34);

    doc.setFontType("default");
    doc.setFontSize(13);
    doc.text("Ursulinestraat 2  3540 Herk-de-Stad  Tel. 013 35 54 30   Fax 013 35 54 34", 50, 43);

    doc.setFontType("bold");
    doc.text("Administratief aanmeldingsformulier", 10, 55);

    doc.setFontType("default");
    doc.text("Schooljaar 2018-2019", 10, 61);

    var today = new Date();
    var date = today.getFullYear() + '-' + (today.getMonth() + 1) + '-' + today.getDate();
    var time = today.getHours() + ":" + today.getMinutes();
    var dateTime = date + ' ' + time;
    doc.text("Datum en uur van de inschrijving:             " + dateTime, 10, 66);

    doc.setFontType("bold");
    doc.text("Studierichting", 10, 75);

    var leerjaar = this.inschrijving.studieRichting.slice(0, 2);
    doc.setFontType("default");
    doc.text("Leerjaar:   " + leerjaar + " |  Studierichting:  " + this.inschrijving.studieRichting.replace(leerjaar, "").replace("(", "").replace(")", "").trim(), 10, 81);

    doc.setFontType("bold");
    doc.text("Gegevens leerling", 10, 90);

    doc.setFontType("default");
    doc.text("Naam en voornaam:       " + this.inschrijving.naam + " " + this.inschrijving.voornaam, 10, 96);

    if(this.service.getChecked() == true) {
      var year = this.inschrijving.geboorteDatum.toString().substring(0,4);
      var month = this.inschrijving.geboorteDatum.toString().substring(5,7);
      var day = this.inschrijving.geboorteDatum.toString().substring(8,10);
      doc.text("Geboortedatum:  " + day + "/" + month + "/" + year, 10, 102);
    } else {
      doc.text("Geboortedatum:  " + this.inschrijving.geboorteDatum.getDate() + "/" + this.inschrijving.geboorteDatum.getMonth() + "/" + this.inschrijving.geboorteDatum.getFullYear(), 10, 102);
    }
    

    doc.setFontType("bold");
    doc.text("Status inschrijving", 10, 165);

    doc.setFontType("default");
    doc.rect(10, 169, 3, 3);
    doc.text("Gerealiseerd", 16, 172);
    doc.rect(55, 169, 3, 3);
    doc.text("Gerealiseerd onder ontbindende voorwaarde", 60, 172);
    doc.rect(160, 169, 3, 3);
    doc.text("Niet-gerealiseerd", 165, 172);

    doc.setFontType("bold");
    doc.text("Ondergetekende gaat akkoord met het pedagogisch project en het schoolreglement te vinden", 10, 180);
    doc.text("op onze website.", 10, 184);

    doc.text("Te herk-de-Stad,   ", 10, 190);

    doc.setFontType("default");
    doc.text(date, 55, 190);

    doc.setFontType("bold");
    doc.text("Handtekening leerling", 10, 200);
    doc.text("Handtekening ouder(s) of de verantwoordelijke", 100, 200);

    doc.setFontType("default");
    doc.text("Overweegt u voor uw kind ondersteuning te vragen?", 10, 230);
    doc.rect(120, 227, 3, 3);

    doc.text("In tweevoud opgemaakt en ondertekend.", 10, 250);
    doc.text("De inschrijvende ouder verklaart dat hij in toepassing van de artikels 374 en 375 van het", 10, 255);
    doc.text("Burgerlijk Wetboek handelt met de instemming van de andere ouder.", 10, 260);

    doc.save("test.pdf");
  }

  encrypt(){
    if(this.inschrijving.leerlingGSM != null){
      this.inschrijving.leerlingGSM = AES.encrypt(this.inschrijving.leerlingGSM, environment.tmpAESkey).toString();
    }

    if(this.inschrijving.leerlingTelefoon){
      this.inschrijving.leerlingTelefoon = AES.encrypt(this.inschrijving.leerlingTelefoon, environment.tmpAESkey).toString();
    }

    if(this.inschrijving.naam != null){
      this.inschrijving.naam = AES.encrypt(this.inschrijving.naam, environment.tmpAESkey).toString();
    }

    if(this.inschrijving.rijksregisternummer){
      this.inschrijving.rijksregisternummer = AES.encrypt(this.inschrijving.rijksregisternummer, environment.tmpAESkey).toString();
    }

    if(this.inschrijving.leerlingEmail){
      this.inschrijving.leerlingEmail = AES.encrypt(this.inschrijving.leerlingEmail, environment.tmpAESkey).toString();
    }
  }

  updateInschrijving() {
    this.inschrijving.ikopieRapport = this.koppieRapportGeg;
    this.inschrijving.ikopieOrigineelGetuigschrift = this.getuigschriftGeg;
    this.inschrijving.biidentiteitskaart = this.identiteitskaartInGeg;
    this.inschrijving.iattestLeerPU = this.attestLeerprobleemGeg;
    this.inschrijving.ibaSOfiche = this.BASOficheGeg;
    this.inschrijving.biavondstudie = this.avondstudieGeg;
    this.inschrijving.biklasgenoten = this.voorkeurKlasgenootjesGeg;
    this.inschrijving.bikeuze = this.motivatieGeg;
    this.inschrijving.bioverlegmoment = this.toestemmingOverleggenGeg;
    this.inschrijving.bigesprekKlassenLeraar = this.bijkomendGesprekGeg;
    this.inschrijving.BIMiddagpas = this.middagpasGeg;
    this.inschrijving.securityCode = Math.random().toString(36).slice(-8);

    this.service.updateLocalInschrijving(this.inschrijving);
    console.log(this.inschrijving);

    this.encrypt();

    // this.service.addInschrijving();

    this.http.post("http://localhost:8080/api/add", this.inschrijving).subscribe(res => console.log(res.json()));

    if (this.service.getBool() == false) {
      this.downloadPDF();
      this.router.navigate(['']);
    } else {
      const dialogRef = this.dialog.open(CodeReminderComponent, {
        width: '500px',
        height: '500px'
      });
    }
    
  }


}
